    function getCollisionMap() { // De array de tiles solidos a Matriz
        const collisionMap = [];
        for (let i = 0; i < mapHeight; i++) {
            const row = [];
            for (let j = 0; j < mapWidth; j++) {
                row.push(collisions[i * mapWidth + j]);
            }
            collisionMap.push(row);
        }
        return collisionMap;
    }

    